import React from "react";
import Layout from "./Layout";
import Signin from "./Signin";
import { isAuth, signout } from "../utils/helper";
import CarouselComponent from "./CarouselComponent";
function Home() {
  return (
    <div>
      <Layout />
      <div className="row mt-4">
        <div className="container" style={{ height: "200px" }}>
          <CarouselComponent />
        </div>
      </div>
      <div className="row" style={{ backgroundColor: "#d9a7c7" }}>
        <div className="col-md-5 my-auto">
          <h1
            className="text-center"
            style={{ color: "#fffcdc", fontWeight: "bold" }}
          >
            THE ADVENTURE YOU HAVE{" "}
          </h1>
        </div>
        <div className="col-md-7 custom-homepage-backgroundImage-2"></div>
      </div>
      <div className="row" style={{ backgroundColor: "#7395ae" }}>
        <div className="col-md-3 custom-homepage-backgroundImage-3"></div>
        <div className="col-md-3"></div>
        <div className="col-md-3 custom-homepage-backgroundImage-4"></div>
        <div className="col-md-3"></div>
      </div>
    </div>
  );
}

export default Home;
